import React from "react";
import Login from "./Login";
import Menu from "./Menu";
import LeftMenu from "./LeftMenu";
import { Container, Row, Col } from "reactstrap";
import Applicants from "./Applicants";

function App() {
  let leftMenuInfo = { title: "LeftMenu"}
  let menuInfo= { title: "Menu"}
  let loginInfo = {title: "Login"}
  let applicantInfo = {title:"Applicants"}
  return (
    <div>

      <Container>
        <Row>
          <Menu info = {menuInfo}></Menu>
        </Row>
        <Row>
          <Col xs="3"><LeftMenu info={leftMenuInfo} ></LeftMenu></Col>
          <Col xs="9"> <Login info={loginInfo}></Login></Col>

        </Row>
        <Row>
          <Applicants info = {applicantInfo}></Applicants>
        </Row>
      </Container>
    </div>
  );
}

export default App;
